import React from 'react'
import './startups.css';

const Startups = () => {
  return (
    <div className='startup'>
    <section>
    <div className='startup1'>
     <h1>WE PARTNER WITH <br/>FOUNDERS</h1>
     <h2>to build ventures</h2>
     <button>KNOW MORE</button>
    </div>
   </section>
    </div>
  )
}

export default Startups;
